## NHỮNG QUYỀN LỢI KHI ĐẾN THƯ VIỆN

1. Được kích hoạt tài khoản và thẻ thư viện điện tử miễn phí sau khi tham dự lớp giới thiệu thư viện đầu khóa và làm bài kiểm tra kiến thức;
2. Được cấp tài khoản truy cập CSDL trực tuyến dùng chung trong ĐHQG-HCM, miễn phí đối với sinh viên năm 1;
3. Được sử dụng tài nguyên thông tin của 09 Thư viện trong ĐHQG-HCM;
4. Được sử dụng không gian thư viện với nhiều tiện ích, thoáng mát và đầy đủ chức năng;
5. Được cộng điểm rèn luyện khi đến với thư viện thường xuyên, tham gia hoạt động hoặc trở thành tình nguyện viên (theo quy định của P. CTSV).
